- input: "TEXT\x1CC00010439\x1CX0\x1C\x1CF3XA\x1CThis amendment is in response to
    the Commission's request for additional information dated June 4, 2013.  The Idaho
    Democratic Party  did not correctly calculate the Fed/State split on its original
    reports and all reports for periods since September 1, 2012 have now been been
    corrected.  In addition,duplicated expenses were originally counted for the purposes
    of the non-federal share, since the software IDP uses did not differentiate between
    paid expenses and memo expenses.  All of the amended reports have now corrected
    these errors.  The non-federal share of allocated activity from 10/01/12 through
    12/31/12 are now correctly reported as $54,667.73.  The transfers from the non-federal
    account in the same period total $56,762.59.  The difference is accounted for
    by unreimbursed Line 21 (a) (ii) from  September that fall within the prior 60
    day period.   The IDP is aware of the rules regarding transferring non-federal
    funds during the 70-day time period, and uses accounting software to enable it
    to determine the proper transfer amounts.  IDP believes that all reports are now
    corrected, and no excessive amounts were transferred.           All employee salaries,
    benefits, payroll taxes, insurance, and reimbursed expenses for employees who
    spend >25% of the month on Federal election activities are paid entirely with
    Federal funds and the expenses are reported on Line 30(b).  All other employee
    costs are shared Federal/Non Federal activities.\n"
